import React from 'react';
import { Link } from 'react-router-dom';
import './landingPage.css';

const LandingPage = () => {
  return (
    <div className="landing-page">
        {/* Navbar */}
        {/* Logo */}
        <nav>
            <Link to="/" ></Link>

            {/* Navigation links */}
            <div>
                <Link to="/login" ></Link>
                <Link to="/signup" ></Link>
            </div>
        </nav>

        {/* Header */}
        {/* Subheading */}
        {/* Intro text */}
        {/* Join waitlist Button */}
        {/* Image on the right */}
    </div>
  );
};

export default LandingPage;
